#globvars-----------------------------------------------------------------------
MENV=10.0.0
MY_SSH_PORT="-p 22"
MY_SCP_PORT="-P 22"
TCMD="ssh $MY_SSH_PORT -2 -c blowfish"
XCMD="ssh $MY_SSH_PORT -2 -c blowfish -X"
CCMD="scp $MY_SCP_PORT -r -2 -c blowfish"
DOCDIR=/usr/share/doc/packages/hyperf
HGDR=get.$$
KEYTYPE=dsa
KEYGENCMD="ssh-keygen -t $KEYTYPE -P '' -f ~/.ssh/id_${KEYTYPE}"
KSCN="ssh-keyscan $MY_SSH_PORT -t rsa1,dsa,rsa -T 10 -f"
KSCL="ssh-keyscan $MY_SSH_PORT -t rsa1,dsa,rsa -T 5"
KWNH=~/.ssh/known_hosts
ENAM=$0
MNAM=$(basename $ENAM)
MDIR=/var/lib/hyperf
LDIR=$MDIR/lib
MLST=$MDIR/master.list
PDIR=$LDIR/precans
BDIR=$LDIR/freecans
FDIR=$LDIR/funcs
PLUSH=bash.bashrc.local
DHPRF=~/.hyperf
PBFL=$DHPRF/$PLUSH.pre-install.backup
BRCP=$DHPRF/dot.bashrc__pre-boost.backup
VRCP=$DHPRF/dot.vimrc__pre-boost.backup
test -e /etc/init.d/sysresccd -a -e /mnt/cdrom/sysrcd.dat && PLUSH=bash/bashrc
test -e /etc/init.d/sysresccd -a -e /etc/gentoo-release && PLUSH=bash/bashrc
test -e $FDIR/plush.fnc && . $FDIR/plush.fnc
WRLDZ=$(IP 2>/dev/null|cut -d\. -f1-3|sed 's/$/.0/')
SRC=$1
DST=$2
USR=root
HYP="screen -d -m"
#SSCMD="rsync --inplace -HIAXPav -e ssh --delete"
SSCMD="rsync -SHIAXPav -e ssh --delete"
#QSCMD="rsync --inplace -HIAXa   -e ssh --delete"
QSCMD="rsync -SHIAXa   -e ssh --delete"
IDIR=/root/bin
MVL=$IDIR/htk.sh
MPLD=HYPERF_0
#DEFCON_END

#funcs-------------------------------------------------------------------------
attach_to_screens (){
   for x in $(screen -ls |grep Detached|awk '{print $1}') ; do
      screen -r $x
   done
}
chaind (){
   CHAIND=1
   until [ $CHAIND = 0 ] ;do
      CHAIND=$(screen -ls |grep -i \(Detached\)|grep -v grep|wc -l)
      sleep .5
   done
}
cOFF (){
   shopt -u nocasematch
}
cON (){
   shopt -s nocasematch
}
copy_ids (){
   ssh-copy-id -i ~/.ssh/id_$KEYTYPE.pub $USR@$i 2>&1 >/dev/null
}
completely_purge_hyperf_from_system (){
   g.uninstall_grouper 2>/dev/null
   c.uninstall_cluster_tools.sh 2>/dev/null
   pushd $IDIR &>/dev/null
   find -samefile $MVL |grep -v $(basename $MVL) |xargs -i rm {}
   popd &>/dev/null
   rm -rf $IDIR/{cqt,grouper}.sh /etc/defcon $DOCDIR $MVL $MDIR*
   rmdir $IDIR &>/dev/null 
   # Restore any available backups
   if [ -e $PBFL.orig ] ; then
      mv $PBFL.orig /etc/$PLUSH
      chown root.root /etc/$PLUSH
      chmod 0644 /etc/$PLUSH 
   fi
   if [ -e $BRCP.orig ] ; then
      mv $BRCP.orig ~/.bashrc
      chown $USER ~/.bashrc
      chmod 0644 ~/.bashrc
   fi
   if [ -e $VRCP.orig ] ; then
      mv $VRCP.orig ~/.vimrc
      chown $USER ~/.vimrc
      chmod 0644 ~/.vimrc
   fi
   rmdir $DHPRF
}
defcon (){
   # Takes 1-to-4 args: 1 (Rqrd) is the DEFCON config filename
   #                    -----------------------------------------------------
   #                    2 (Opt) is '--personald': use a personal DEFCON_FILE
   #                    -----------------------------------------------------
   #                    3 (Opt) is "--editd": Edit the DEFCON_FILE, then exit
   #                    4 (Opt) is "[SEARCH STRING]": append to the '--editd'
   #                                                  option; Vim will jump to
   #                                                  that SEARCH STRING
   #                                                  location in DEFCON_FILE.
   # ------------------------
   # Description of defcon():
   # ------------------------
   # This function allows a calling script (parent) to carry around its own
   # default configuration, rather than having to use an external package
   # manager to provide it a default configuration file.  If the parent's code
   # *DOES* call defcon(), it does not preclude the use of an external package
   # manager to provide said default configuration file for the parent, it
   # simply gives the parent the *OPTION* of not having to depend on such a
   # package manager...if desired. 
   #
   # A 1st-run of the script essentially acts like an installation of the
   # default configuration to a file in a standard location.  If the
   # '--personald' option is provided to this function, the location of that
   # defcon file is in ~/.defcon/ directory.  Otherwise, the location of the
   # default configuration is in the standard /etc/defcon/ directory.  If the
   # '--editd' option is provided to the script, then defcon will open the
   # Defcon file for editing, then will cause the parent script to completely
   # exit -- i.e. completely terminate execution.
   #
   # -------------------------------------
   # Full Description of the Defcon System
   # -------------------------------------
   # defcon() is one of the handiest functions in HyPerf.  Many scripts in the
   # HTK use it to provide for their default configuration.
   #
   #
   # (The following comments show examples of use of this function [defcon()],
   # explain how it works, and explain its options and arguments.
   #
   # =======================
   # Example Usages (Quick):
   # =======================
   # defcon  parent.conf
   # defcon  parent.conf  $@
   # defcon  parent.conf  --editd  $@
   # defcon  parent.conf  --editd  EXAMPLE_JUMP=mysetting  $@
   # defcon  parent.conf  --personald  $@
   # defcon  parent.conf  --editd  --personald  $@
   # defcon  parent.conf  --personald  --editd  $@
   # defcon  parent.conf  --editd EXAMPLE_JUMP=mysetting  $@
   # defcon  parent.conf  --personald  --editd  $@
   # defcon  parent.conf  --personald  --editd EG_SETG=eg_value  $@
   #
   # ============================
   # Example Usage Explained (1):
   # ============================
   # ┌┬┬┬┬┬───────────────← Calling defcon()
   # ││││││  ┌┬┬┬┬┬┬┬─────← Name of this script's DEFCON_FILE in /etc/defcon/
   # ││││││  ││││││││  ┌┬─← All Remaining options (2-N) passed to this function
   # ↓↓↓↓↓↓  ↓↓↓↓↓↓↓↓  ↓↓
   # --------------------
   # defcon  htk.conf  $@
   # --------------------
   #
   # ============================
   # Example Usage Explained (2):
   # ============================
   # ┌┬┬┬┬┬────────────────────────────← Calling defcon()
   # ││││││
   # ││││││  ┌┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬← Dynamically determined DEFCON_FILE name
   # ││││││  ││││││││││││││││││││││││││  to match executable name
   # ││││││  ││││││││││││││││││││││││││
   # ││││││  ││││││││││││││││││││││││││  ┌┬┬┬┬┬┬┬┬┬┬─────← Use 'personal' mode
   # ││││││  ││││││││││││││││││││││││││  │││││││││││
   # ││││││  ││││││││││││││││││││││││││  │││││││││││  ┌┬─← All Remaining options
   # ││││││  ││││││││││││││││││││││││││  │││││││││││  ││   (2-N) passed on to
   # ↓↓↓↓↓↓  ↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓  ↓↓↓↓↓↓↓↓↓↓↓  ↓↓   defcon()
   # ---------------------------------------------------
   # defcon  $(basename -s .sh $0).conf  --personald  $@
   # ---------------------------------------------------
   #
   # How defcon() works:
   # -------------------
   # When defcon() is called, it is provided a configuration filename as its
   # 1st argument.
   #
   # That file is called the parent's 'DEFCON_FILE'.
   #
   # Defcon() checks for the DEFCON_FILE in either the default /etc/defcon/
   # directory (standard mode) or the ~/.defcon/ directory (personal mode).
   #
   # If its 1st argument is found, then defcon() sources that file into the
   # parent script.  If the indicated file is *NOT* found, then defcon() parses
   # the parent script for all settings (and code) that it can find between the
   # beginning tag "#DEFCON_BEGIN" and the ending tag "#DEFCON_END".
   #
   # It then copies the parsed settings to the 1st argument.
   #
   # The 1st execution of a parent (that sources and correctly calls this
   # function) essentially acts as an installation of that parent's DEFCON_FILE
   # to either the system or the personal location, depending on the calling
   # options.
   #
   # Subsequent executions of that same parent will read the settings
   # (i.e. source them) from that DEFCON_FILE into the parent, overriding any
   # matching settings in the parent.
   #
   # ---------------------------------------------------------------------------
   # NOTE: The aforementioned tags must both be located at the beginning of
   #       their respective lines in order for defcon() to parse their included
   #       settings correctly.
   #
   #       Generally, those tags can (and should) be found in the global
   #       variables section at the start of scripts that follow the HyPerf
   #       coding methodology.
   # ---------------------------------------------------------------------------
   #
   # Any settings, found in the parent script but not existing in the
   # DEFCON_FILE, will be set for the parent,  as they are defined in the parent
   # script.  This has the effect of allowing an upgraded script to add settings
   # in the parent, while previous customizations from a pre-existing
   # DEFCON_FILE still affect the parent.
   #
   # Administrators should make changes to the desired DEFCON_FILE of a parent
   # script and those settings will take affect when the parent script is
   # executed.  Administrators should *NOT* change the settings in the parent
   # script itself.
   #
   # Including a DEFCON_FILE in a software package will have the same affect as
   # an installation would, so scripts that use defcon() can still be packaged
   # as normal in RPM, DPKG, make, tarballs, etc.
   #
   # Arguments:
   # ----------
   # 1. The Defcon File (required):
   #    ---------------------------
   #    The first argument to defcon() is required and is the DEFCON_FILE.
   #
   #    See the usage examples, above, for ideas on how to creatively pass the
   #    config filename to defcon() so that it will automatically set a desired
   #    name, based on the name of the executable.
   #
   #    ------------------------------------------------------------------------
   #    TIP: Links can be used to have different configurations for the same
   #         base script, for example.
   #    ------------------------------------------------------------------------
   #
   #
   # 2. Personal Mode: (--personald)
   #    --------------
   #    Personal mode is set by passing the '--personald' option to defcon().
   #    It takes no option arguments.  If this option is used, defcon() will set
   #    the directory for defcon configurations for the parent to ~/.defcon/.
   #
   #    This mode should be used by parent scripts that are not meant to be
   #    executed system-wide, but a DEFCON_FILE is still desirable.
   #
   #
   # 3. Edit Mode: (--editd)
   #    ----------
   #    Defcon is sensitive to the '--editd' long option (no option argument).
   #    The parent script can pass all the command line arguments to defcon()
   #    and it can parse them for any instance of '--editd'.
   #
   #    If defcon() detects that '--editd' has been passed to it, it will
   #    perform all of its other standard functions, with the exception that
   #    instead of sourcing the DEFCON_FILE into the parent, it will open it in
   #    Vim for editing.
   #
   #    Edit mode allows defcon() to be used as an installer and instant editor
   #    of the DEFCON_FILE.  Rather than having to first find and then
   #    subsequently edit the DEFCON_FILE, the user of the parent script can
   #    provide the '--editd' option to it and defcon() will automatically open
   #    up for editing.
   #
   #    This is exceptionally handy for rapid configuration.
   #
   #
   # 4. Jump mode: (--editd [SEARCH STRING]    <-- Jump into the defcon file for
   #                                               quick editing
   #    ----------
   #    This mode is simply an extension to edit mode:  When calling defcon()
   #    with the '--editd' option, a (single) trailing string can be provided to
   #    defcon() to allow the user to jump to the 1st occurance of that string
   #    in the DEFCON_FILE.  If *anything* is found trailing the '--editd'
   #    option, it will be considered a search strings and the first word will
   #    be used for the jump.
   #
   #    Jump editing can make changing of a common settings much quicker.
   #
   #    -----------------------------------------------------------------
   #    CAVEAT: Defcon() only supports a single jump per editing session.
   #    -----------------------------------------------------------------
   #
   #
   # ---------------------------------------------------------------------------
   # NOT A TYPO: There is a trailing lowercase letter 'd' on each of the
   #             '--personald' and '--editd' long-options.
   #
   #             Defcon() will ignore similar options without the trailing 'd'.
   # ---------------------------------------------------------------------------
   #
   local S      # Defcon source script
   local F      # Defcon configuration file
   local D      # Defcon directory
   local P      # Defcon pattern
   local V      # Vimsearch pattern provided with '--editd' option
   #
   S=$0           #Defcon source
   test -z $1 && (echo "Missing DEFCON filename.  Exiting"
                  exit
                 )
   P="^#DEFCON_(BEGIN|END)"
   #Set defcon mode:
   case "$@" in
      *--personald*)
         #Set 'personald' mode
         D=~/.defcon
         set -- $(echo $@ | sed 's/--personald//g')
         ;;
      *)
         D=/etc/defcon
         ;;
   esac
   #Set defcon configuration file path:
   F=${D}/${1}
   #Parse the options passed to this function for personal mode:
   if  [ ! -e $F ] ; then
      #If defcon file does not exist, create and source it.
      mkdir -p $D
      #Set patterns
      local -a a_P=($(grep -Eno "$P" $S|cut -d":" -f1))
      tail -n+$((${a_P[0]}+1)) $S|head -$((${a_P[1]} - $((${a_P[0]}+1)))) > $F
      chmod 644 $F
      . $F
   elif [ -r $F ] ; then
      . $F
   else
      chmod 644 $F
      . $F
   fi
   case $@ in
      *--editd*)
      echo "--------------------------------------------------"
      echo "Tap Enter to edit the defcon file for this script."
      echo "--------------------------------------------------"
      read -s -t 10 -n 1
      # If a search pattern was *ALSO PASSED* to defcon, along with the edit
      # Jump to a specific spot if 
      if [ ! -z $3 ] ; then
         V=+/$3
      fi
      vim -c 'sy on' \
          -c ':set syntax=sh' \
          $V \
          $F
      #Exit script if edit option was passed
      exit
      ;;
   esac
}
